This skips over some content. For example, if LIST_AD_DELTA = 3 and you wish to display 8 content items, your last row will be an ad because (position: 9 % 3 = 0).


So, just change the formula to get additionalContent in getItemCount() to:


    additionalContent = (data.size() + (data.size() / LIST_AD_DELTA)) / LIST_AD_DELTA;

